import React from "react";

const LoginButton = () => {
  const handleLogin = () => {
    // Ensure the URL matches the backend login endpoint
    window.location.href = "http://localhost:8080/auth/xbox/login";
  };

  return <button onClick={handleLogin}>Log in with Xbox</button>;
};

export default LoginButton;
